Audio: MP3, Stereo, 192 Kbps (CBR)

Notes: Probably not a true 192 Kbps encode (e.g. transcoded from lower bitrate): Harsh 16 KHz frequency cutoff (typical of ~128 Kbps encodes). Still, a complete, decent release of a somewhat rarely shared album. Thanks MS, seeders.

